const Types = {
  ADD_FILTER: 'ADD_FILTER',
  REMOVE_FILTER: 'REMOVE_FILTER'
};

const addFilter = location => ({
  type: Types.ADD_FILTER,
  data: location
});

const removeFilter = location => ({
  type: Types.REMOVE_FILTER,
  data: location
});

export default {
  Types,
  addFilter,
  removeFilter
};
